import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Item from './Item.js';


class List extends Component {

    static defaultProps = {
        content: "",
        itemArr: []
    }

    render() {
        var listEntries = this.props.entries;

        function generateLine(item) {
            return <button key={item.key}>{item.val}</button>
        }

        var listItems = listEntries.map(generateLine);

        const { itemArr } = this.props;
        const list = itemArr.map(
            thing => (<Item key={thing.id} thing={thing} />)
        );

        return (
            <div>
                {list}
            </div>
        );

    }
}


export default List;
